import React, { useState, useEffect } from "react";

interface FinancialItem {
  id: number;
  type: string;
  description: string;
  amount: number;
  date: string;
}

const FinancialManagement: React.FC = () => {
  const [financialData, setFinancialData] = useState<FinancialItem[]>([]);

  useEffect(() => {
    // Aqui você fará uma chamada à API para obter os dados financeiros
    // Por enquanto, usaremos dados de exemplo
    const sampleFinancialData: FinancialItem[] = [
      {
        id: 1,
        type: "Receita",
        description: "Consulta",
        amount: 100,
        date: "2024-03-18",
      },
      {
        id: 2,
        type: "Despesa",
        description: "Medicamentos",
        amount: 50,
        date: "2024-03-17",
      },
      // Outros registros financeiros...
    ];
    setFinancialData(sampleFinancialData);
  }, []);

  // Aqui você pode implementar funções para adicionar, remover ou atualizar registros financeiros

  return (
    <div>
      <h2>Gestão Financeira</h2>
      <table>
        <thead>
          <tr>
            <th>Tipo</th>
            <th>Descrição</th>
            <th>Valor</th>
            <th>Data</th>
          </tr>
        </thead>
        <tbody>
          {financialData.map((item) => (
            <tr key={item.id}>
              <td>{item.type}</td>
              <td>{item.description}</td>
              <td>{item.amount}</td>
              <td>{item.date}</td>
            </tr>
          ))}
        </tbody>
      </table>
      {/* Aqui você pode adicionar ferramentas adicionais de gestão financeira, como lançamento financeiro da agenda ou prontuário, cadastro de convênios, etc. */}
    </div>
  );
};

export default FinancialManagement;
